import { useState } from 'react';

const LoginButton = () => {
  const [isClicked, setIsClicked] = useState(false);

  const btnHandler = () => {
    setIsClicked((prevState) => !prevState);
    console.log(isClicked);
  };

  return <button onClick={btnHandler}></button>;
};

export default LoginButton;
